import "./Nav.css";

const Nav = ({ outModal, addSpot }) => {
  return (
    <div className="nav-container">
      <h1>Kite</h1>
      <button>Add Spot</button>
      <button
        onClick={() => {
          outModal(true);
        }}
      >
        Sign out
      </button>
    </div>
  );
};

export default Nav;
